import React from 'react'

const HeroSection = () => {
	return (
		<div className="HeroSection container">
			<div className="HeroSection-inner container">
			<h4>Take a Glimpse Into The Beautiful City Of:</h4>
			<h3>Istanbul</h3>
			<button className="btn-default">Go There</button>
			</div>
		</div>
	);
}

export default HeroSection;
